import React from 'react';

class Artboard extends React.Component {
  constructor(props) {
    super(props);
    this.state = { //state初期化
      isLoaded: false,
      items: []
    };
  }
  componentDidMount() { //render直後に行いたい処理を書くところ
    fetch("/api/v1/list") //api
      .then(res => res.json())
      .then(json => {
        console.log(json.rates);
        this.setState({
          isLoaded: true,
          items: json.rates
        });
      });
  }

  render() {
    var { items, isLoaded } = this.state;
    console.log(items);
    if (!isLoaded) {
      return <div>...Loading</div>;
    } else {
      return (
        <section className="section-artboard section-bottom">
          Artboard
          <ul>
          {items.map(item => (
            <li key={item.title}>
              {item.title} {item.done}
            </li>
          ))}
        </ul>
        </section>
      );
    }
  }
}

export default Artboard;
